[quote]Freedom Fighters is the name of a DC Comics comic book superhero team made up of characters acquired from the defunct company Quality Comics. The team first appeared in a Justice League of America/Justice Society of America team-up, which ran in Justice League of America #&amp;#039;s 107 and 108 (October and December 1973), written by Len Wein and drawn by Dick Dillin. Their own ongoing series premiered with Freedom Fighters #1 (April 1976), written by Gerry Conway and Martin Pasko, and drawn by Rik Estrada.[/quote]

